import { Component } from "react";
import { Link } from "react-router-dom";
import { NavList } from "./NavList";
import {Ug} from './images/PG.jpg'
import './images/NavbarCoureses.css'
import Logo from './images/logo2.jpeg';
import { FooterContant } from "./FooterContant";



import { permaLinks } from "./FooterContant";

class NavbarCoureses extends Component{
    render(){
        return(
            <>
            <nav className="">
                <div className="main-img-contant" style={{display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
                <img src={Logo} width={500}  alt="" />

                </div>
                <h3 style={{textAlign: 'center'}}>...tutoring by grads from IIT/IISc</h3>

                {/* menu icons */}
                <div className="menu-icons">
                    <i className=''></i>
                </div>

                {/* nav-links for ug pg mba ca */}
                <div className="">
                <div className="nav-cords">
                    {NavList.map((item,index) => {
                        return(
                            <div key={index}  className="main-card card" >

                                <img src={item.src} width={400} alt=""/>
                                <div className="intro1">
                                <h2 className=""> {item.title}</h2>
                                <ul className="links">
                                    <li><a href={item.url}>{item.title1}</a></li>
                                    <li><a href={item.url}>{item.title2}</a></li>
                                    <li><Link className="links ">{item.title3}</Link></li>                  
                                    <li><Link className="links ">{item.title4}</Link></li>
                                </ul>
                                </div>
                            </div> 
                        )
                    })}
                  </div>
                </div>
                <footer>
                    {FooterContant.map((footeritem,footrtIndex) => {
                        return(

                            <ul key={footrtIndex}>
                                <li style={{color: 'red'}}>{footeritem.aboutEgrad}</li>
                                <li>{footeritem.permalinks}</li>
                                <li><Link>{footeritem.Home}</Link></li>
                                <li><Link>{footeritem.About}</Link></li>
                                <li><Link>{footeritem.career}</Link></li>
                                <li><Link>{footeritem.CountactUs}</Link></li>

                            </ul>

                    )})}
                </footer>
            </nav>

            </>
        )
    }
}

export default NavbarCoureses;
